import React, { useEffect, useState } from 'react';
import UserTable from '../componentes/UserTable';
import OwnerTable from '../componentes/OwnerTable';
import PetTable from '../componentes/PetTable';
import '../pages/dashboard.css'; // Aseg칰rate de importar los estilos

const USER_API = 'http://localhost:8090/bd_petcare/api/users';
const OWNER_API = 'http://localhost:8090/bd_petcare/api/owners';
const PET_API = 'http://localhost:8090/bd_petcare/api/pets';

function Dashboard() {
  const [users, setUsers] = useState([]);
  const [owners, setOwners] = useState([]);
  const [pets, setPets] = useState([]);
  const [selectedPanel, setSelectedPanel] = useState('usuarios');

  useEffect(() => {
    fetchUsers();
    fetchOwners();
    fetchPets();
  }, []);

  const fetchUsers = () => {
    fetch(`${USER_API}/all`)
      .then(res => res.json())
      .then(setUsers)
      .catch(err => console.error('Error cargando usuarios:', err));
  };

  const fetchOwners = () => {
    fetch(`${OWNER_API}/all`)
      .then(res => res.json())
      .then(setOwners)
      .catch(err => console.error('Error cargando due침os:', err));
  };

  const fetchPets = () => {
    fetch(`${PET_API}/all`)
      .then(res => res.json())
      .then(setPets)
      .catch(err => console.error('Error cargando mascotas:', err));
  };

  const handleUserDelete = (id) => {
    fetch(`${USER_API}/delete/${id}`, { method: 'DELETE' })
      .then(() => {
        fetchUsers();
        fetchOwners();
        fetchPets();
      })
      .catch(err => console.error('Error al eliminar usuario:', err));
  };

  const handleUserUpdate = (user) => {
    fetch(`${USER_API}/save`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(user)
    })
      .then(() => fetchUsers())
      .catch(err => console.error('Error al actualizar usuario:', err));
  };

  const handleOwnerUpdate = (owner) => {
    fetch(`${OWNER_API}/save`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(owner)
    })
      .then(() => fetchOwners())
      .catch(err => console.error('Error al actualizar due침o:', err));
  };

  const handlePetDelete = (id) => {
    fetch(`${PET_API}/delete/${id}`, { method: 'DELETE' })
      .then(() => fetchPets())
      .catch(err => console.error('Error al eliminar mascota:', err));
  };

  const handlePetUpdate = (pet) => {
    fetch(`${PET_API}/save`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(pet)
    })
      .then(() => fetchPets())
      .catch(err => console.error('Error al actualizar mascota:', err));
  };

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <h3 className="sidebar-title">Panel de Control</h3>
        <ul className="sidebar-menu">
          <li onClick={() => setSelectedPanel('usuarios')} className={selectedPanel === 'usuarios' ? 'active' : ''}>
            游녻 Usuarios
          </li>
          <li onClick={() => setSelectedPanel('duenos')} className={selectedPanel === 'duenos' ? 'active' : ''}>
            游 Due침os
          </li>
          <li onClick={() => setSelectedPanel('mascotas')} className={selectedPanel === 'mascotas' ? 'active' : ''}>
            游냤 Mascotas
          </li>
        </ul>
      </div>

      <div className="dashboard-content">
        {selectedPanel === 'usuarios' && (
          <>
            <h2>Gesti칩n de Usuarios</h2>
            <UserTable users={users} onDelete={handleUserDelete} onUpdate={handleUserUpdate} />
          </>
        )}
        {selectedPanel === 'duenos' && (
          <>
            <h2>Gesti칩n de Due침os</h2>
            <OwnerTable owners={owners} onUpdate={handleOwnerUpdate} />
          </>
        )}
        {selectedPanel === 'mascotas' && (
          <>
            <h2>Gesti칩n de Mascotas</h2>
            <PetTable pets={pets} onUpdate={handlePetUpdate} onDelete={handlePetDelete} />
          </>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
